import { createAsyncThunk } from "@reduxjs/toolkit";

const getData=createAsyncThunk('data',async(url,thunkAPI)=>{
const data=await fetch(url).then((a)=>a.json()).then((res)=>{
    return res
})
return data
})
export  {getData}
